import 'bootstrap/dist/css/bootstrap.min.css'
import {BrowserRouter, Routes, Route} from 'react-router-dom'
import Location from './Location';

function App() {
  return (
    <div className="App">
        <BrowserRouter>
          <Routes>
            <Route path= '/' element ={<Location/>}> </Route>

          </Routes>

        </BrowserRouter>
    </div>
  );
}

export default App;
